import React from "react";

function Signup()
{
    return (
        <div>
        <h1>Signup</h1>
        <button onClick={()=>navigate("/signup")}>Signup</button>
        <button onClick={()=>navigate("/")}>Home</button>
        </div>
    );
}

export default Signup;
